import '../../stile/stile.css'
import { Link } from 'react-router-dom'



type Props = {
menu1: String;
menu2: String;
menu3: String;
menu4: String;
menu5: String;

}

function Menu(menu:Props) {
   return (
      
    <div className= 'flexT'>  
<table>
          <thead className='thead td'>
             <tr>
                <td>< Link to={'/'}>{ menu1.menu1 }</Link> </td>
                <td>< Link to={'Página Inicial'}>{ menu2.menu2 } </Link> </td>
                <td>< Link to={'Documentos'}>{ menu3.menu3 }</Link> </td>
                <td>< Link to={'Info'}>{ menu4.menu4 }</Link> </td>
                <td>< Link to={'Chat'}>{ menu5.menu5 }</Link> </td> 
             </tr>
           </thead>
</table>
</div>  
)     
}
export default Menu;
